    componentDidMount() {
        fetch("https://newsapi.org/v2/everything?q=tesla&from=2021-06-26&sortBy=publishedAt&apiKey=API_KEY")
        .then
    }

    render() {
        return (
            <div></div>
        )
    }
}

export default Cooking
